import React, { Component } from 'react'
import Header from './layout/Header'
export class OpenPost extends Component {

    render(){
        const {title,body} =this.props.posts;
        return  (
        <div>
             <Header title={this.props.posts.title} subtitle={this.props.posts.title}/>
            <h2>{this.props.posts.title}</h2>
                <pre>{this.props.posts.body}</pre>
        </div>
        )
    }
}

export default OpenPost
